		public ICollection<StockSymbol> GetStockSymbols(bool hasHeaders)
		{
			var result = new HashSet<StockSymbol>();

			var filename = DotNetEnv.Env.GetString("filename", "");

			if (filename.IsEmpty())
				new Exception("filename not found in environment variables.");
			
			using (var sr = new StreamReader(filename.ToApplicationPath()))
			{
				var line = "";
				var lineList = new List<string>();

				if (hasHeaders)
					line = sr.ReadLine();

				while (!sr.EndOfStream)
				{
					line = sr.ReadLine();

					if (!line.IsEmpty())
					{
						var tmp = new StockSymbol();
						lineList = line.Split(new[] {'\t'}).ToList();

						for (var i = 0; i < lineList.Count; i++)
						{
							switch (i)
							{
								case 0:
									tmp.Symbol = lineList[i];
									break;
								case 1:
									tmp.Name = lineList[i];
									break;
								case 2:
									if (decimal.TryParse(lineList[i], out var lastSale))
										tmp.LastSale = lastSale == 0 ? 0.01M : lastSale;
									break;
								case 3:
									if(decimal.TryParse(lineList[i], out var marketCap))
										tmp.MarketCap = marketCap;
									break;
								case 4:
									tmp.ADR = lineList[i];
									break;
								case 5:
									tmp.Sector = lineList[i];
									break;
								case 6:
									tmp.Industry = lineList[i];
									break;
							}
						}

						if (!tmp.Symbol.IsEmpty() && tmp.LastSale > 0)
							result.Add(tmp);

						sr.DiscardBufferedData();
					}
				}
			}

			var ass = JsonConvert.SerializeObject(result);
			return result;
		}

